import React from 'react'
import './serviceCard.css'

function ServiceCard(props) {
  return (
    <div>
      <img src={props.imageid} alt={props.alt}/>
      <h4>{props.cardtitle}</h4>
      <button>More</button>
    </div>
  )
}

export default ServiceCard
